{"query":"query {
  # Resource name
  artists {
    # List is the standard name for returning multiple entries
    list(limit: 2 offset: 1) {
      # meta value
      __typename
      id
      name
    }
    # Find is a reserved name and will always return a single value
    # It's a type-safe alias for list(single: true)
    find(id: 3) {
      id
      name
    }
  }
  # _total is a special service operation. It counts the result of the requested operation without the limit and offset arguments.
  # Use for pagination.
  service {
    _total(operation: "artists.list")
  }
}","operationName":"Operations"}

{"query":"query {
  artists {
    # List all Elton John (id:3) albums containing the word "Blue"
    artist:find(id: 3) {
      name      
      albums(where: {name: {contains: "Blue"}}) {
        name
      }
    }
  }

  albums {
    # Lists all albums that have any recording containing the word "love"
    albums:list(
      #GOTCHA: `album` executes an INNER JOIN with `recording`. Since there are two recordings in the album "Goodbye Yellow Brick Road" containg the word `love`, the result appears twice.
      # Remove the comment below to fix.
      #distinct: true
      where: {      
        recordings: {name: {contains: "love"}}
      }
    ) {
      id
      name      
    }
  }
}","operationName":"Operations"}

{"query":"query {
  artists {
    list(where: {or: [{id: {eq: 1}} {id: {eq: 2}}]}) {
      id
      name
    }
  }

  albums {
    #only result_in and result_nin is supported
    list(where: {id_artist: {result_in: "artists.list.id"}}) {
      id
      name
    }
  }
}","operationName":"Operations"}

{"query":"query {
    konstnarer:artists {
      lista:list {
        id
        namn:name
        skivalbum:albums {
            id
            namn:name
        }
      }
    }
}","operationName":"Operations"}

{"query":"query {
  artists {
    # Pluck is available on queries to simplify returns, but can't be auto generated on the Schema    
    count:find(pluck: "countAll") {
      # Every field can use the "expression" argument to execute arbitrary SELECT expressions. The field is still checked on the isFieldReadable call of the Resource, if applicable.
      countAll (expression: "count(id)")
    }
	}
}","operationName":"Operations"}

{"query":"query {
  artists {
    list(
      # group is an array of fields
      group: ["id"]
      # having follow the same rules as `where`
      having: {
        # note that custom expressions must use Map defined names (no `id` shortcut)
        _condition: {expr: "count(albums.id_album)" where: {gt: 2}}
      }
    ){
      name
      albumCount (expression: "count(albums.id_album)")
	  }
  }
}","operationName":"Operations"}

{"query":"query {
  artists {
    list(
      # ordered list of {ORDER: FIELD}
      order: [{asc: "name"} {desc: "albums.name"}]
      # each join gets an item on the list
      join: [{LEFT: "albums"}]
    ){
      id
      name
      albumName (expression: "albums.name")
	  }
  }
}","operationName":"Operations"}

{"query":"query {
  artists {
    list(
      distinct: true
      where: {
        albums: {release_date: {gt: 100}}
        or: [
          {name: {eq: "Mili"}} 
          {
            and: [
              {name: {startsWith: "M"}}
              {id: {lte: 2}}
            ]
          }
        ]
      }
    ){
      id
	  }
  }
}","operationName":"Operations"}

{"query":"mutation {
  artists {
    insert(
      object: {
        name: "Suisei"
      }) {
      id
      name
    }
  }

  albums {
    insert_batch(
      objects: [
        # To-One relationships are set with the {association: {id: $x}} object
        { artist: {id: 1} name: "Debutant Ball" }
        { artist: {id: 2} name: "Specter" }
      ]) {
        id
        name
    }
  }
}"}

{"query":"mutation {
  artists {
    upsert(
      object: {
        # BasicResource upsert acts like update if `id` is provided
        id: 1
        name: "Suisei"
      }) {
      id
      name
    }
  }

  albums {
    upsert_batch(
      objects: [
        # if ID is not provided (empty/null), behaves like insert. With BasicResource, database must support lastInsertId and PK must be autogenerated.
        { id: null artist: {id: 1} name: "Debutant Ball" }
        { id: 3 artist: {id: 2} name: "Specter" }
        { artist: {id: 1} name: "Still Still Stellar" }
      ]) {
        id
        name
    }
  }
}"}

{"query":"mutation {
  artists {
    update(
      id: 1
      set: {
        name: "Suisei"
      }) {
      id
      name
    }
  }

  albums {
    update_batch(
      where: {or: [{name: {startsWith: "Me"}} {id: {eq: 7}} ]} 
      set: {
        release_date: 100
      }) {
        id
        name
        release_date
    }
  }
}","operationName":"Operations"}

{"query":"mutation {
  #delete operations return the number of deleted records
  artists {
    delete(id: 4)
  }

  recordings {
    delete_batch(
      where: {
        or: [
          {name: {startsWith: "Me"}} 
          {id: {eq: 7}} 
        ]
      } 
    )
  }
}","operationName":"Operations"}

{"query":"mutation {
  users {
    update(
      id: 2
      set: {
        groups:  {
          # append Group 1, 2 to user 2
          append: [1, 2]
          # delete Group 3 from user 2
          delete: [3]
          # remove user 2 from all groups, append Group 1 and 3
          replace: [1, 3]
        }
      }
    ) {
      id
      login
      groups {
        id
        name
      }
    }
  }
}","operationName":"Operations"}

{"query":"mutation {
  artists {
    # same rules for update, insert, upsert
    update(
      id: 2
      set: {
        # Associaton operations execute their operation and set the foreign key on the child row to the defined above
        albums: {
          #set id_artist = 2 where id_album in (6, 7)
          update: [6, 7]          
          # insert album (name, id_artist) values ("...", 2)
          insert: [
            {
              name: "To Kill a Living Book"
            }
          ]
          # upsert operation. Without special behavior, same as "update or insert"          
          upsert: [
            # here, acts as update
            {
              id: 4
              name: "Paper Bouquet"
            }
            # here, as insert
            {
              name: "Gunners in the Rain"
            }
            # insert (assuming id 500 doesnt exist), forcefully sets primary key. If this is not allowed, handle it in the upsert method of the Resource.
            {
              id: 500
              name: "Key Ingredient"
            }
          ]

          # delete the associated values. if albums 4, 5 are not associated to artist 2, they are not modified.
          # if the parent key is nullable, tries setting it to null
          # else, tries to delete the record.
          # nullability is defined on the foreign key AttributeMap.
          delete: [8, 5]

        }
      }

    ) {
      id
      albums {
        id
        name
      }
    }
  }
}","operationName":"Operations"}

{"query":"# Custom query operations can be defined by implementing the CustomOperationsInterface and implementing the getQueries function.

